export const ORDERS_NAMES = {
  new: 'новый',
  assigned: 'назначен',
  confirmed: 'подтвержден',
  canceled: 'отменен',
  complete: 'завершен',
};

export const DRIVER_STATUS = {
  free: 'свободен',
  busy: 'занят',
};

export const CARS_DECL = [
  'свободная машина',
  'свободные машины',
  'свободных машин',
];

export const STATUS_CAR_NAMES = {
  free: 'свободен',
  busy: 'занят',
};
